var test=require("tape");var b64=require("../");test("decode url-safe style base64 strings",function(b){var c=[255,255,190,255,239,191,251,239,255];var d=b64.toByteArray("//++/++/++//");for(var a=0;a<d.length;a++){b.equal(d[a],c[a])}d=b64.toByteArray("__--_--_--__");for(a=0;a<d.length;a++){b.equal(d[a],c[a])}b.end()});